CREATE  PROCEDURE `AddCompassFeature`()
BEGIN

    DECLARE maxId INTEGER;
    DECLARE compassId VARCHAR(36);
    DECLARE existentRows INTEGER;

    SELECT objectId INTO compassId
    FROM Enterprise
    WHERE name = 'compass'
    LIMIT 1;

    IF compassId is not null THEN

        SELECT COUNT(1) INTO existentRows
        FROM Feature
        WHERE  enterpriseId   = compassId
        AND   feature = 'TimeAttendance';

        SELECT MAX(id)+1 INTO maxId
        FROM feature;

        IF existentRows = 0 THEN
            SET @sqlstmt = 'INSERT INTO Feature (id,objectId,active,timeCreated,timeUpdated,enterpriseId, feature,adminOnly) VALUES';

            SET @sqlstmt = CONCAT(@sqlstmt,' (', maxId, ',UUID(), true, now(), now(), \'', compassId,'\', \'TimeAttendance\', true)');

            PREPARE st FROM @sqlstmt;
            EXECUTE st;
            DEALLOCATE PREPARE st;
        ELSE
            SELECT CONCAT('Row for Compass already exists') CreateFeatureErrorMessage;
        END IF;
    ELSE
        SELECT CONCAT('Enterprise compass does not exis') CreateFeatureErrorMessage;
    END IF;

END ;;
