CREATE  PROCEDURE `delete_password`()
BEGIN   
    DECLARE counter INT DEFAULT 1;
    REPEAT
        DELETE FROM Password WHERE userName NOT IN (SELECT DISTINCT userName FROM User WHERE userName IS NOT NULL)
        LIMIT 10000; 
        SET counter = counter + 1;
        DO SLEEP(1);
    UNTIL counter >= 10 END REPEAT;
END ;;
