CREATE  PROCEDURE `DropColumn`(
    given_table    VARCHAR(64),
    given_column    VARCHAR(64)
)
BEGIN

    DECLARE ColumnIsThere INTEGER;

    SELECT COUNT(1) INTO ColumnIsThere
    FROM INFORMATION_SCHEMA.columns
    WHERE  table_name   = given_table
    AND   column_name   = given_column
    AND   table_schema = database();

    IF ColumnIsThere = 1 THEN
        SET @sqlstmt = CONCAT('ALTER TABLE ',given_table,' DROP COLUMN ',given_column);
        PREPARE st FROM @sqlstmt;
        EXECUTE st;
        DEALLOCATE PREPARE st;
    ELSE
        SELECT CONCAT('column ',given_column,' does not exists on Table ',
        given_table) CreatecolumnErrorMessage;
    END IF;

END ;;
DELIMITER ;
