CREATE  PROCEDURE `DropIndex`(
    given_table    VARCHAR(64),
    given_index    VARCHAR(64)
)
BEGIN

    DECLARE IndexIsThere INTEGER;

    SELECT COUNT(1) INTO IndexIsThere
    FROM INFORMATION_SCHEMA.STATISTICS
    WHERE  table_name   = given_table
    AND   index_name   = given_index
    AND   table_schema = database();

    IF IndexIsThere > 0 THEN
        SET @sqlstmt = CONCAT('DROP INDEX ',given_index,' ON ',database(),'.',given_table);
        PREPARE st FROM @sqlstmt;
        EXECUTE st;
        DEALLOCATE PREPARE st;
    ELSE
        SELECT CONCAT('Index ',given_index,' does not exists on Table ',
        given_table) CreateindexErrorMessage;
    END IF;

END ;;
