CREATE  PROCEDURE `ModifyColumnLength`(
    given_table    VARCHAR(64),
    given_column    VARCHAR(64),
    is_varchar INTEGER,
    is_not_null INTEGER,
    len    INTEGER
)
BEGIN

    DECLARE ColumnIsThere INTEGER;

    SELECT COUNT(1) INTO ColumnIsThere
    FROM INFORMATION_SCHEMA.columns
    WHERE  table_name   = given_table
    AND   column_name   = given_column
    AND   character_maximum_length = len
    AND   table_schema = database();

    IF ColumnIsThere = 0 THEN
        SET @sqlstmt = CONCAT('ALTER TABLE ',given_table,' MODIFY COLUMN ',given_column);
        IF is_varchar = 1 AND is_not_null = 1 THEN
            SET @sqlstmt = CONCAT(@sqlstmt,' varchar(',len,') not null');
            PREPARE st FROM @sqlstmt;
            EXECUTE st;
            DEALLOCATE PREPARE st;
        ELSEIF is_varchar = 1 THEN
            SET @sqlstmt = CONCAT(@sqlstmt,' varchar(',len,')');
            PREPARE st FROM @sqlstmt;
            EXECUTE st;
            DEALLOCATE PREPARE st;
        END IF;

    ELSE
        SELECT CONCAT('column ',given_column,' ',len,' already exists on Table ',
        given_table) CreatecolumnErrorMessage;
    END IF;

END ;;
DELIMITER ;
