CREATE  PROCEDURE `PurgeClockFlowQueue`(
    batch_limit    INTEGER,
    search_status VARCHAR(64)
)
BEGIN
	
    drop temporary table if exists ClockFlowQueue_tmp;
    create temporary table ClockFlowQueue_tmp engine=memory 
	select distinct t1.objectReferenceId from ClockFlowQueue t1 inner join ClockFlowQueue t2 
		on (t1.objectReferenceId = t2.objectReferenceId and t1.status = t2.status and t1.id < t2.id)
    where t1.status = search_status limit batch_limit;
   
	delete t1.* FROM ClockFlowQueue t1
	INNER JOIN ClockFlowQueue t2 ON t1.objectReferenceId = t2.objectReferenceId and t1.status = t2.status and t1.id < t2.id
	WHERE
		t1.id < t2.id AND
		t1.status = search_status AND
        t1.objectReferenceId in (select * from ClockFlowQueue_tmp);
-- 	drop temporary table if exists ClockFlowQueue_tmp;

END ;;
