CREATE  PROCEDURE `RemoveAutoIncrToId`(
    given_table    VARCHAR(64)
)
BEGIN

    DECLARE AutoIncrIsThere INTEGER;
    DECLARE TableExists INTEGER;

    SELECT COUNT(1) INTO AutoIncrIsThere
    FROM INFORMATION_SCHEMA.TABLES
    WHERE  table_name   = given_table
      AND table_schema = database()
      AND   AUTO_INCREMENT   IS NOT NULL
    ;

    IF AutoIncrIsThere = 1 THEN

        SELECT COUNT(1) INTO TableExists
        FROM INFORMATION_SCHEMA.COLUMNS
        WHERE  table_name   = given_table
          AND table_schema = database()
          AND column_name = 'id'
        ;

        IF TableExists = 1 THEN

            SET @sqlstmt = CONCAT('ALTER TABLE ',database(),'.',given_table,' modify column id BIGINT NOT NULL');
            PREPARE st FROM @sqlstmt;
            EXECUTE st;
            DEALLOCATE PREPARE st;
        ELSE
            SELECT CONCAT('Table Does not exist ',
                          given_table) AlterTableErrorMessage;
        END IF;
    ELSE
        SELECT CONCAT('Auto Increment does not exist on Table ',
                      given_table) AlterTableErrorMessage;
    END IF;

END ;;
DELIMITER ;
