CREATE  PROCEDURE `RenameTable`(
    given_table    VARCHAR(64),
    new_table_name    VARCHAR(64)
)
BEGIN

    DECLARE TableExists INTEGER;

    SELECT COUNT(1) INTO TableExists
    FROM INFORMATION_SCHEMA.tables
    WHERE  table_name   = given_table
    AND table_schema = database()
    AND table_type = 'BASE TABLE';

    IF TableExists = 1 THEN
        SET @sqlstmt = CONCAT('ALTER TABLE ',database(),'.',given_table,' RENAME TO ',database(),'.',new_table_name);
        PREPARE st FROM @sqlstmt;
        EXECUTE st;
        DEALLOCATE PREPARE st;
    ELSE
        SELECT CONCAT('Table ',given_table,' does not exist') RenameTableErrorMessage;
    END IF;

END ;;
DELIMITER ;
